import React from 'react';
// import './Slider.css';
import $ from 'jquery';

import Img1 from './img/1.1.png'
import Img2 from './img/1.2.png'
import Img3 from './img/1.3.png'
import Img4 from './img/1.4.png'
import Img5 from './img/1.5.png'

class Slider extends React.Component {
  componentDidMount() {
    $(this.refs.slider).flexslider({
      animation: "slide",
      directionNav: true,
      controlNav: false,
      prevText: "<i class='fas fa-angle-left'></i>",
      nextText: "<i class='fas fa-angle-right'></i>"
    });
  }

  render() {
    return (
      <div>
        <br/><br/><br/>
        <div className="flexslider" ref="slider">
          <ul className="slides">
            <li>
              <img src={Img1} alt="" />
            </li>
            <li>
              <img src="img/1.2.png" alt="" />
            </li>
            <li>
              <img src="img/1.3.png" alt="" />
            </li>
            <li>
              <img src="img/1.4.png" alt="" />
            </li>
            <li>
              <img src="img/1.1.png" alt="" />
            </li>
          </ul>
        </div>
      </div>
    );
  }
}

export default Slider;
